class Container extends React.Component{
    constructor(props){
        super(props);
    }
    removeElm(e){
        e.preventDefault();
        console.log('remove',e.target.name);
        this.props.removeElm(e.target.name);
    }
    addElm(e){
        e.preventDefault();
    }
    render(){
        return <ul>{this.props.list.map(elm=><li>elm <button name={elm} onClick={this.removeElm.bind(this)}>remove</button></li>)}</ul>;
    }
}
